import { NavLink } from "react-router-dom";

function Section({ title, more : boolean = false}) {
    return(
           <section>
               <header className="flexx item-center justify-between">
               <h3 className="text-2xl text-white font-semibold tracking-tight">{title}</h3>
               {more && (
                   <NavLink className={"text-sm font-semibold uppercase"} to={more}>

                   </NavLink>
                   
               )}

               </header>
           </section>
    )
}
export default Section
